import React from "react";

const TableCell = ({ Renderer, cellHoverHandler, isNearest, ...props }) => {
   let style = isNearest ? { backgroundColor: "aqua" } : null;
   return (
      <td
         style={style}
         onMouseEnter={cellHoverHandler}
         onMouseLeave={(style = null)}
      >
         <Renderer {...props} />
      </td>
   );
};

export default TableCell;
